import React, { useEffect, useState } from 'react';
import axios from "axios";
import { Box, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography } from '@mui/material';

const Home = () => {

    const [dataset,setData]=useState([]);
  useEffect(()=>{
    axios.get('https://jsonplaceholder.typicode.com/users').then((res)=>{
      console.log(res.data);
      setData(res.data);
    })
  },[]);

  const tableContaierstyle = tablestyle - {
      width:"max-conta"
  }

  return (
    <div>
    <br/>
    <Typography align='center' fontSize={30} color={'Red'}>Welcome to Employee Dashboard</Typography>
    <br/>
    
    <TableContainer component={Paper} style={tableContaierstyle}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell  style={{fontFamily:"-moz-initial",fontSize:20,color:'Darkgreen'}}>ID</TableCell>
            <TableCell style={{fontFamily:"-moz-initial",fontSize:20,color:'Darkgreen'}}>Name</TableCell>
            <TableCell style={{fontFamily:"-moz-initial",fontSize:20,color:'Darkgreen'}}>Email</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {dataset.map((row) => (
        <TableRow key={row.id} sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>
              <TableCell component="th" scope="row">
                {row.id}
              </TableCell>
              <TableCell>{row.name}</TableCell>
              <TableCell>{row.email}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </div>
  )
}

export default Home
